## Describe where/how to find data.
Our dataset comes from [IPUMS USA](https://usa.ipums.org/usa/index.shtml). 

Reference:
Steven Ruggles, Sarah Flood, Matthew Sobek, Daniel Backman, Annie Chen, Grace Cooper, Stephanie Richards, Renae Rodgers, and Megan Schouweiler. IPUMS USA: Version 15.0 [dataset]. Minneapolis, MN: IPUMS, 2024.
https://doi.org/10.18128/D010.V15.0

The original data of this website came from censuses as well as the American Community Surveys (ACS) that began in 2000 and are still going on today. We chose our dataset from this website IPUMS because this website contains datasets that are large, valid and complex, containing detailed microdata, which aims to facilitate transformative research, education, and policy-making by aggregating data across times and places. It makes the datasets on this website very appropriate for our research to streamline our analysis of changes, data merging, and comparative research.


## Describe the different data files used and what each variable means.

### Table contains all the variables we have

We have highlighted all key dependent variables (RENTGRS) and independent variables (INCTOT) in bold.

| Variable | Description                           |
|----------|---------------------------------------|
| **RENTGRS**  | Monthly gross rent                    |
| KITCHEN  | Kitchen or cooking facilities         |
| ROOMS    | Number of rooms                       |
| NFAMS    | Number of families in household       |
| AGE      | Age                                   |
| MARST    | Marital status                        |
| RACE     | Race                                  |
| EMPSTAT  | Employment status                     |
| **INCTOT**   | Total personal income                 |
| FTOTINC  | Total family income                   |
| POVERTY  | Poverty status                        |


## Describe any cleaning you had to do for your data.
- Here is the link to our cleaned dataset [cleaned dataset.](./dataset//rent_income.rds)

- The code for cleaning and recoding the datasets, please see class blog 2 and 3. 

- For our dependent variable—rent—we exclude records indicating a rent of 0. This exclusion is based on the understanding that a 0 rent suggests the individual owns their home or lives in a situation not pertinent to our target research population, which is individuals who rent their housing.

- Exclude data entries characterized by specific codes indicative of missing or unknown values, as well as those representing values deemed inappropriate for analytical purposes. The following table shows the variables we processed:
* Given the vast size of the original dataset, which includes millions of records, we opted to remove these entries directly. This decision does not compromise our ability to conduct a thorough analysis, as the remaining dataset is still large and clean enough for reliable and robust research conclusions.

| Variable     | Description                     | Notes                                                                                                   |
|---------------|--------------------|-------------------------------------|
| **INCTOT**   | Total personal income           | Specific codes detailed below:                                                                          |
|              |                                 | 0000001 = \$1 or break even (2000, 2005-onward ACS and PRCS)                                            |
|              |                                 | 9999999 = N/A                                                                                           |
|              |                                 | 9999998 = Unknown                                                                                       |
| **FTOTINC**  | Total family income             | Specific codes detailed below:                                                                          |
|              |                                 | -000001 = Net loss (1950)                                                                               |
|              |                                 | 9999998 = Not ascertained (1950)                                                                        |
